	<script>

    jQuery(document).ready(function() {
      var scrolled=0;
      jQuery("#down").on("click" ,function(){
        if (scrolled == 1800) {
          scrolled = scrolled + 0;
        }
        if (scrolled != 1800) {
          scrolled=scrolled+300;
        }

        jQuery(".legend-wrapper").animate({
          scrollTop:  scrolled
        });
      });

      jQuery("#up").on("click" ,function(){
        if (scrolled == 0) {
          scrolled = scrolled + 0;
        }
        if (scrolled != 0) {
          scrolled=scrolled-300;
        }

        jQuery(".legend-wrapper").animate({
          scrollTop:  scrolled
        });
      });
    });


	</script>




